import './App.css'
import NavBar from './components/NavBar'
import Home from './components/Home'
import Projects from './components/Projects'
import Contacts from './components/Contacts'

function App() {
  return (
    <main>
      <NavBar />
      <section id="home">  {/* Assigning 'home' as id */}
        <Home />
      </section>
      <section id="projects">  {/* Assigning 'projects' as id */}
        <Projects />
      </section>
      <section id="contacts">  {/* Assigning 'contacts' as id */}
        <Contacts />
      </section>
    </main>
  );
}

export default App;
